import React from "react";

const Pagination = ({ dogsPerPage, totalDogs }) => {
  let pageNumbers = [];

  for (let i = 1; i <= Math.ceil(totalDogs / dogsPerPage); i++) {
    pageNumbers.push(i);
  }

  return (
    <nav>
      <ul>
        {pageNumbers.map((number) => (
          <li key={number}>
            <a onClick={()=>paginate(number)}href="!#">{number}</a>
          </li>
        ))}
      </ul>
    </nav>
  );
};
export default Pagination;
